  return (
    <Styled.background>
      <Wrapper>
        <Section
          title="Features &amp; Solutions"
          description="consectetur quam. Morbi pellentesque eu dolor luctus sagittis. Praesent  commodo velit eget urna mollis dignissim."
          alignLeft
